import React from "react";
import { Button } from "@material-ui/core";

function button(props) {
  return (
    <Button color={props.color} size="medium" variant="contained"
        onClick={(e)=>{console.log(e.target.value)}}
    >
      {props.value}
    </Button>
  );
}

export default button;
